/*---- Structures ----*/

struct TwoStrings {
	const char *a;
	const char *b;
};

struct ThreeStrings {
	const char *a;
	const char *b;
	const char *c;
};

struct FourStrings {
	const char *a;
	const char *b;
	const char *c;
	const char *d;
};

struct SixStrings {
	const char *a;
	const char *b;
	const char *c;
	const char *d;
	const char *e;
	const char *f;
};


// Global variables
static int numTestCases = 0;


/*---- Test cases ----*/

static void testReplace() {
	CurvePoint p = CurvePoint::G;
	CurvePoint q = CurvePoint::G;
	q.twice();
	assert(p != q);
	p.replace(q, 0);
	assert(p != q);
	p.replace(q, 1);
	assert(p == q);
	numTestCases++;
}


